import React from "react";

const konumlar = ["Konum 1", "Konum 2", "Konum 3", "Konum 4", "Konum 5"];

class Konumlar extends React.Component {
  render() {
    return (
      <div>
        <h1>Konumlar</h1>
        <ul>
          {konumlar.map((konum, index) => (
            <li key={index}>{konum}</li>
          ))}
        </ul>
      </div>
    );
  }
}

export default Konumlar;
